import React from 'react';

const Posts = async () => {
  const response = await fetch("https://strangers-things.herokuapp.com/api/2110-VPI-WEB-PT/posts")
    .then(response => response.json())
    .then(result => {
      console.log(result);
    })
    .catch(console.error);

  return (
    <>
      <h1>Posts View</h1>
      {posts.map((post) => (

        <div key={post._id}>
          <p>{post.location}</p>
          <p>{post.willDeliver}</p>
          <p>{post.message}</p>

          <p>{post.active}</p>
          <p>{post._id}</p>
          <p>{post.author._id}</p>
          <p>{post.author.username}</p>

          <p>{post.cohort}</p>
          <p>{post.title}</p>
          <p>{post.description}</p>
          <p>{post.price}</p>
          <p>{post.createdAt}</p>
          <p>{post.updatedAt}</p>
          <p>{post._v}</p>
          <p>{post.isAuthor}</p>


        </div>

      ))}
    </>
  )
}


export default Posts;
